import bpy
import base64
import os

class ShowImageInWindowOperator(bpy.types.Operator):
    bl_idname = "wm.show_image_in_window"
    bl_label = "Show Blender CheatSheet"
    bl_options = {'REGISTER', 'UNDO'}

    def execute(self, context):
        # Base64 string of the image (replace with your actual Base64 data)
        base64_image_data = (
                        ""

        )
        
        # Decode Base64 string
        image_data = base64.b64decode(base64_image_data)
        
        # Define the path where the image will be saved
        file_path = "C:\ProgramData/temp_image.jpg"
        
        # Check if the C:/ drive is accessible and writable
        if not os.path.isdir("C:/"):
            self.report({'ERROR'}, "C:/ drive is not accessible.")
            return {'CANCELLED'}
        
        # Ensure directory exists and create if not
        os.makedirs(os.path.dirname(file_path), exist_ok=True)
        
        # Save the image data to the file
        try:
            with open(file_path, "wb") as image_file:
                image_file.write(image_data)
        except PermissionError:
            self.report({'ERROR'}, "Permission denied: Unable to write to C:/ drive.")
            return {'CANCELLED'}
        except Exception as e:
            self.report({'ERROR'}, f"Failed to write image data: {e}")
            return {'CANCELLED'}
        
        # Load the image into Blender
        try:
            image = bpy.data.images.load(file_path)
        except Exception as e:
            self.report({'ERROR'}, f"Failed to load image: {e}")
            return {'CANCELLED'}
        
        # Create a new window with an image editor area
        bpy.ops.wm.window_new()
        new_window = bpy.context.window_manager.windows[-1]
        
        # Set the area type to IMAGE_EDITOR and display the image
        new_area = new_window.screen.areas[0]  # Assuming the first area is available
        new_area.type = 'IMAGE_EDITOR'
        
        for space in new_area.spaces:
            if space.type == 'IMAGE_EDITOR':
                space.image = image
                break
        
        return {'FINISHED'}

class ShowImagePreferences(bpy.types.AddonPreferences):
    bl_idname = __name__

    hotkey: bpy.props.StringProperty(
        name="Hotkey",
        description="Hotkey to trigger the Show Image Operator",
        default='F3',
        maxlen=10,
        update=lambda s, c: update_keymap()  # Call update_keymap when hotkey is changed
    )

    def draw(self, context):
        layout = self.layout
        layout.prop(self, "hotkey")

def update_keymap():
    # Retrieve user-defined hotkey
    user_hotkey = bpy.context.preferences.addons[__name__].preferences.hotkey

    # Ensure we are working with a valid keymap
    kc = bpy.context.window_manager.keyconfigs.addon
    km = kc.keymaps.get('Window')

    if km is None:
        km = kc.keymaps.new(name='Window', space_type='EMPTY')

    # Remove any existing keymap items for this operator
    for kmi in km.keymap_items:
        if kmi.idname == ShowImageInWindowOperator.bl_idname:
            km.keymap_items.remove(kmi)
    
    # Add keymap item with the user-defined hotkey
    if user_hotkey:
        km.keymap_items.new(ShowImageInWindowOperator.bl_idname, user_hotkey, 'PRESS')

def register():
    bpy.utils.register_class(ShowImageInWindowOperator)
    bpy.utils.register_class(ShowImagePreferences)
    
    # Initial setup of keymap with the default hotkey
    update_keymap()

def unregister():
    bpy.utils.unregister_class(ShowImageInWindowOperator)
    bpy.utils.unregister_class(ShowImagePreferences)
    
    # Clean up keymap
    kc = bpy.context.window_manager.keyconfigs.addon
    km = kc.keymaps.get('Window')
    if km:
        for kmi in km.keymap_items:
            if kmi.idname == ShowImageInWindowOperator.bl_idname:
                km.keymap_items.remove(kmi)

if __name__ == "__main__":
    register()
